from solution import Solution

sol = Solution()

# Test all ordered pairs a != b using s = a*a + b*b
failures = []
for a in range(1,10):
    for b in range(1,10):
        if a == b:
            continue
        s = str(a)*a + str(b)*b
        expected = str(a) + str(b)
        out = sol.findValidPair(s)
        if out != expected:
            failures.append((s, expected, out))

print('Pair tests run:', 72)
print('Failures:', len(failures))
for f in failures[:10]:
    print('FAIL', f)

# Random tests
import random
random.seed(0)

def oracle(s: str) -> str:
    counts = {}
    for ch in s:
        counts[ch] = counts.get(ch, 0) + 1
    for i in range(len(s)-1):
        a, b = s[i], s[i+1]
        if a == b:
            continue
        if counts.get(a,0) == int(a) and counts.get(b,0) == int(b):
            return a + b
    return ''

rand_failures = []
for _ in range(1000):
    n = random.randint(2, 20)
    s = ''.join(str(random.randint(1,9)) for _ in range(n))
    expected = oracle(s)
    out = sol.findValidPair(s)
    if out != expected:
        rand_failures.append((s, expected, out))

print('Random tests run:', 1000)
print('Random failures:', len(rand_failures))
for f in rand_failures[:10]:
    print('FAIL', f)

if not failures and not rand_failures:
    print('ALL TESTS PASS')
